def T_sht(E, M, r):
    vspp = 2/m * (E-U(r)) - M**2/m/r**2
    if vspp < 0:
        return 0
    return 1 / (vspp) ** 0.5

def T0(e, l, r):
    if e > 0:
        return 1
    if 2/m * (e-U(r)) - l**2/m/r**2 <= 0:
        return 1
    Q = qQ(e, l, r)
    return scipy.integrate.quad(lambda x: T_sht(e, l, x), 0, Q)[0]

def ro(r):
    #return ro_0 * np.exp(-r/r_0)
    c = -1
    A = 1
    #return 1 / (c * r**2 + A * r ** 2 * np.log(r))
    return 216 / (A**3 * r **6 - 6 * c * A**2 * r**4 + 12 * c**2 * A * r**2 - 8 * c**3)

def U(r):
    #return -4 * np.pi * G * ro_0 * r_0 ** 3 / r * (np.exp(-r / r_0) * ((r/r_0 + 1) ** 2 + 1) + 2)
    #return -scipy.integrate.quad(lambda x: x ** 2 * ro(x), 0, r)[0] / r

    index = int(r//0.02222222222)
    if index >= len(ar_of_u):
        return 0
    return ar_of_u[index]

    return -scipy.integrate.quad(lambda x: x ** 2 * ro(x), 0, r)[0] / r * G

def under_sqrt(e, l, r):
    val = 2/m * (e-U(r)) - l ** 2 / m / r ** 2
    if val < -1:
        return -1
    return val

def qQ(e, l, r):
    fid = 10
    if e > 0 or under_sqrt(e,l,r) < 0:
        print('error in qQ')
        return
    r_up = r
    while under_sqrt(e,l,r_up) > 0:
        r_up += r/100
